import './index.scss';
import {Link, NavLink, useNavigate} from "react-router-dom";

const Navbar = () => {

    const [username, setUsername] = '';

    const getName = async () => {
        let name = await fetch('https://username-generator-api.glique.repl.co/gen', {
            method: 'GET',
            headers: {
                'Content-Type': 'application/json'
            }
        }).then((res) => res.json);
        console.log(name);
    }

    getName();

    return (
        <section id={'nav'}>
            <NavLink to={'/'} id={'logo'}>
                Card Me Daddy
            </NavLink>

            <form className={'change-name'}>
                <input type={'text'} placeholder={ username }/>
                <input type={'submit'} value={'Change Name'}/>
            </form>
        </section>
    );
};

export default Navbar;
